        "title": "Beautiful People (Ed Sheeran + Khalid) A Cappella Cover in VR180! | Sam Tsui",
        "description": "LIKE & SUBSCRIBE HERE: https://bit.ly/2GgYN28\nWe’re coming on TOUR to ASIA THIS NOVEMBER:Tickets at: http://www.hunnie.com/SamTsuiAsia2019\n14/11 - Kochi, India \n16/11 - (HUNNIE FEST) MIECC, Kuala Lumpur, Malaysia \n17/11 - Capitol Theater, Singapore  \n19/11 - The Pallas, Jakarta, Indonesia \n21/11 - Legacy Taipei, Taiwan \n23/11 - RCA Hall, Bangkok, Thailand \n25/11 - SM Skydome, Manila, Philippines \n27/11 - TTN, Kowloon, Hong Kong \n29/11 - Mao Livehouse, Shanghai, China\n01/12 - Mao Livehouse, Beijing, China\n\nListen to “Beautiful People” on Spotify - https://open.spotify.com/track/7aVgbo1Xpc3iaSFhhev7FO?si=ZeMSVci9STOO-Gb93XqA3Q\nGet the track on iTunes:  https://music.apple.com/us/album/beautiful-people-acapella-single/1478195361?ls=1\n\nWanted to take advantage of our trip to Sicily AND the immersive capabilities of VR180 to do an a cappella cover in one of the beautiful spots we got to visit here in Italy - so shot this at the Isole dei Ciclopi in Acitrezza, rocks that were supposedly the very ones the Cyclops Polyphemus threw at Odysseus while he was making his escape as described in the Odyssey!! Many thanks to the tourists and locals who probably were very confused as to what we were doing as we shot this video in such an iconic and beautiful spot — and if you want to see more from our Italian vacation, make sure you’re following me on my instagram stories!!\n\nFOLLOW MY SOCIAL & GET IN TOUCH!\nhttp://www.samtsui.com\nhttp://www.twitter.com/SamuelTsui\nhttp://www.facebook.com/SamTsuiMusic\n\n“BEAUTIFUL PEOPLE” Lyrics\n\nWe are, we are, we are\nL.A. on a Saturday night in the summer\nSundown and they all come out\nLamborghinis and their rented Hummers\nThe party's on, so they're headin' downtown\n('Round here) everybody's lookin' for a come up\nAnd they wanna know what you're about\nMe in the middle with the one I love and\nWe're just tryna figure everything out\nWe don't fit in well\n'Cause we are just ourselves\nI could use some help\nGettin' out of this conversation, yeah\nYou look stunning, dear\nSo don't ask that question here\nThis is my only fear, that we become\nBeautiful people\nDrop top, designer clothes\nFront row at fashion shows\n\"What d'you do?\" And, \"Who d'you know?\"\nInside the world of beautiful people\nChampagne and rolled-up notes\nPrenups and broken homes\nSurrounded, but still alone\nLet's leave the party\nThat's not who we are\n(We are, we are, we are)\nWe are not beautiful\nYeah, that's not who we are\n(We are, we are, we are)\nWe are not beautiful\nL.A. mm\nDrove for hours last night and we made it nowhere (nowhere, nowhere)\nI see stars in your eyes when we're halfway there (all night)\nI'm not fazed by all them lights and flashin' cameras (uh)\n'Cause with my arms around you, there's no need to care\nWe don't fit in well\nWe are just ourselves\nI could use some help\nGettin' out of this conversation, yeah\nYou look stunning, dear\nSo don't ask that question here\nThis is my only fear, that we become\nBeautiful people\nDrop top, designer clothes\nFront row at fashion shows\n\"What d'you do?\" And \"Who d'you know?\"\nInside the world of beautiful people\nChampagne and rolled-up notes\nPrenups and broken homes\nSurrounded, but still alone\nLet's leave the party\nThat's not who we are\n(We are, we are, we are)\nWe are not beautiful, yeah\nYeah, that's not who we are\n(We are, we are, we are)\nWe are not beautiful\nWe are, we are, we are\nWe are not beautiful\n\n\nAbout Sam Tsui:\nWelcome the the Samily! What began with a love of pop music - deconstructing and reinterpreting\nsome of my favorite songs into creative covers, medleys, and mashups - has taken me on a journey\nthat now allows me to release original albums and songs, create epic music videos, and tour around\nthe world to meet the amazing fans that make it all possible. Subscribe to hear great music, join me\nand discover my story (with behind-the-scenes videos and vlogs) and make sure you never miss an\nupload by clicking that bell!\n\n\nSam Tsui\nhttps://www.youtube.com/TheSamTsui",
